import React, {Component} from 'react';
import axios from 'axios'
import './Chatbox.css';

class Chatbox extends Component {
    constructor(props){
        super(props)
        this.state = {
            page: "Sex"
        };
    }
    async componentDidMount() {
        var options = {
            method: 'POST',
            url: 'https://infermedicavolodimir-kudriachenkov1.p.rapidapi.com/computeDiagnosis',
            headers: {
              'content-type': 'application/x-www-form-urlencoded',
              'x-rapidapi-key': '89a501b0a9msh27282160a5b3e9ap1518d8jsncfc1011e0ec4',
              'x-rapidapi-host': 'Infermedicavolodimir-kudriachenkoV1.p.rapidapi.com'
            },
            data: {information: {
                sex: "male",
                age: 30,
                evidence: {
                    "sex": "male",
                    "age": {
                      "value": 30
                    },
                    "evidence": [
                      {
                        "id": "s_1193",
                        "choice_id": "present",
                        "source": "initial"
                      },
                      {
                        "id": "s_488",
                        "choice_id": "present"
                      },
                      {
                        "id": "s_418",
                        "choice_id": "present"
                      }
                    ]
                  }
            }, appId: 'aa2fb846', appKey: 's'}
          };

          await axios.request(options).then(function (response) {
              console.log(response.data);
          }).catch(function (error) {
              console.error(error);
          });
    }
    render() {
        return (
            <div className='Chatbox'>
                <h1 className='Chatbox-Title'>Chatbox</h1>
                <div className='Chatbox-Content'>
                </div>
            </div>
        );
    }
}

export default Chatbox;
